import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
import { database, ref, get } from "../firebase";
import "./StartTrans.css"; // Optional: Add CSS for better styling

const StartTrans = () => {
  const location = useLocation();
  const [userData, setUserData] = useState(null);
  const [loading, setLoading] = useState(true);

  const { username, amount } = location.state || {};

  const generateCustRefNo = () => {
    return Math.floor(10000000000000 + Math.random() * 90000000000000).toString();
  };

  const getCurrentFormattedDateTime = () => {
    const now = new Date();
    const pad = (n) => n.toString().padStart(2, "0");
    return `${now.getFullYear()}-${pad(now.getMonth() + 1)}-${pad(now.getDate())} ${pad(
      now.getHours()
    )}:${pad(now.getMinutes())}:${pad(now.getSeconds())}`;
  };

  useEffect(() => {
    const fetchUser = async () => {
      if (!username || !amount) return;

      try {
        const usersRef = ref(database, "users");
        const snapshot = await get(usersRef);

        if (snapshot.exists()) {
          const usersData = snapshot.val();
          const matchedUser = Object.values(usersData).find((user) => user.name === username);

          if (matchedUser) {
            setUserData({
              ...matchedUser,
              custrefno: generateCustRefNo(),
              amount,
              paymentdate: getCurrentFormattedDateTime(),
              integrationType: "nonseamless",
              callbackurl: "https://cashier.minipay.work/gateway/skill-in/pay/notify/result",
              mop: "UPI",
              moptype: "dynamic",
              mopdetails: "customer will scan UPI QR to pay",
            });
          }
        }
      } catch (error) {
        console.error("Error fetching user data:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchUser();
  }, [username, amount]);

  if (loading) {
    return <div style={{ textAlign: "center", padding: "2rem" }}>Loading transaction details...</div>;
  }

  if (!userData) {
    return <div style={{ textAlign: "center", padding: "2rem" }}>User not found or data incomplete.</div>;
  }

  return (
    <div style={{ padding: "2rem" }}>
      <h2>ðŸ§¾ Transaction Details</h2>
      <table className="trans-table">
        <tbody>
          <tr>
            <th>Auth ID</th>
            <td>{userData.authId}</td>
          </tr>
          <tr>
            <th>Auth Key</th>
            <td>{userData.authKey}</td>
          </tr>
          <tr>
            <th>Customer Ref No</th>
            <td>{userData.custrefno}</td>
          </tr>
          <tr>
            <th>Amount</th>
            <td>â‚¹{userData.amount}</td>
          </tr>
          <tr>
            <th>Payment Date</th>
            <td>{userData.paymentdate}</td>
          </tr>
          <tr>
            <th>Mobile No</th>
            <td>{userData.mobile}</td>
          </tr>
          <tr>
            <th>Email ID</th>
            <td>{userData.email}</td>
          </tr>
          <tr>
            <th>Integration Type</th>
            <td>{userData.integrationType}</td>
          </tr>
          <tr>
            <th>Address</th>
            <td>{userData.address}</td>
          </tr>
          <tr>
            <th>Callback URL</th>
            <td>{userData.callbackurl}</td>
          </tr>
          <tr>
            <th>MOP</th>
            <td>{userData.mop}</td>
          </tr>
          <tr>
            <th>MOP Type</th>
            <td>{userData.moptype}</td>
          </tr>
          <tr>
            <th>MOP Details</th>
            <td>{userData.mopdetails}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default StartTrans;
